import mongoose from "mongoose";

const userSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true,
  },
  email: {
    type: String,
    required: true,
    unique: true,
  },
  password: {
    type: String,
    required: true,
  },
  image: {
    type: String,
    // image to data base64 site is used for this link
    default:
      "data:image/jpeg;base64,",
  },
  address: {
    type: Object,
    default: { line1: "", line2: "" },
  },
  gender: {
    type: String,
    default: "Not Selected",
  },
  dob: {
    type: String,
    default: "Not Selected",
  },
  phone: {
    type: String,
    default: "0000000000",
  },
});

const userModel = mongoose.model("user", userSchema);
export default userModel;
